import './App.css';
import Header from './Components/Header';
import Hero from './Components/Hero';
import Home from './Container/Home';
import {BrowserRouter as Router, Switch, Route} from 'react-router-dom';

function App() {
  return (
    <Router>
    <div className="App">

      <Header/>
      <Hero/>
      <Route path='/'component={Home}/>
    </div>
    </Router>
  );
}

export default App;
